DROP TABLE IF EXISTS service;
CREATE TABLE service (
    no INTEGER PRIMARY KEY,
    id VARCHAR(20),
    nopol VARCHAR(20),
    km_akhir INTEGER,
    no_kwitansi VARCHAR(20),
    no_invoice VARCHAR(30),
    hari VARCHAR(10),
    tgl DATE,
    jam TIME,
    bhnmtrl VARCHAR(10),
    id_brg VARCHAR(20),
    nama_brg VARCHAR(100),
    hpp INTEGER,
    hrg_satuan INTEGER,
    jml INTEGER,
    diskon INTEGER,
    ppn INTEGER,
    subtotal INTEGER,
    wkt_up TIMESTAMP,
    byr_dp INTEGER,
    tgl_byr_dp DATE,
    diskon_srv INTEGER,
    bayar INTEGER,
    tipe_byr VARCHAR(20),
    card_type VARCHAR(20),
    card_number VARCHAR(30),
    approve_code VARCHAR(20),
    tgl_selesai DATE,
    jam_selesai TIME,
    mekanik VARCHAR(30),
    officer VARCHAR(30),
    keluhan TEXT,
    keterangan TEXT,
    status VARCHAR(20),
    kasir VARCHAR(30),
    retur INTEGER,
    tgl_retur DATE,
    tgl_next_srv DATE,
    del_reminder INTEGER
);
TRUNCATE TABLE service;
